import React from 'react'
import {useForm} from "react-hook-form"
import APIService from '../APIService'
import Select from 'react-select'
import {useCookies} from 'react-cookie';

function GenerateForm() {

    // const {register, handleSubmit, errors} = useForm()

    return (
        <form>
            <label className = "form-label">Number of workouts in plan</label>
            <Select 
                options = {[{value:1},{value:2},{value:3},{value:4}]}
                getOptionLabel={options => options["value"]}
                getOptionValue={(options) => options['value']}  
                type="number_of_workouts" 
                name="number_of_workouts"
                name="number_of_workouts"
                />
            <Select name="target">
                options = {[{"STR":"Strength building"},{"WL":"Weight Loss"},{"EN":"Endurance"}]}
                getOptionLabel={options => options["value"]}
                getOptionValue={(options) => options['value']}  
                type="number_of_workouts" 
                name="number_of_workouts"
                name="number_of_workouts"
                <option value="" selected disabled hidden>Choose here</option>
                <option value="STR">Strength building</option>
                <option value="WL">Weight Loss</option>
                <option value="EN">Endurance</option>
            </Select>
        </form>
    )
}

export default GenerateForm
